const raw = $input.first().json.data;
const line = raw.split('\n').find(l => l.startsWith('data: '));
const rpc = JSON.parse(line.replace('data: ', ''));
const text = rpc.result.content[0].text;

const areas = JSON.parse(text);

// nome exato da área
const NOME_AREA = 'SINESP-PPE (Gerenciamento de Requisitos)';

// filtra aqui
const area = areas.find(a => a.nome === NOME_AREA);

// se não achar, falha explícita
if (!area) {
  throw new Error(`Área não encontrada: ${NOME_AREA}`);
}

// retorna somente a área desejada
return [{ json: area }];

const out = [];

for (const item of $input.all()) {
  const raw = item.json.data;

  const match = raw.match(/data:\s*(\{.*\})/s);
  if (!match) continue;

  const rpc = JSON.parse(match[1]);
  const text = rpc.result.content[0].text;
  const requisitos = JSON.parse(text);

  for (const r of requisitos) {
    out.push({ json: r });
  }
}

return out;

const items = $input.all();

for (const item of items) {
  const ct =
    item.binary?.data?.mimeType ||
    item.json?.headers?.['content-type'] ||
    '';

  let ext = 'bin';

  if (ct.includes('pdf')) ext = 'pdf';
  else if (ct.includes('zip')) ext = 'zip';
  else if (ct.includes('png')) ext = 'png';
  else if (ct.includes('jpeg') || ct.includes('jpg')) ext = 'jpg';
  else if (ct.includes('markdown')) ext = 'md';
  else if (ct.includes('text/plain')) ext = 'txt';
  else if (ct.includes('html')) ext = 'html';
  else if (ct.includes('xml')) ext = 'xml';

  item.json.__fileName = `${item.json.title}.${ext}`;
}

return items;

const fs = require('fs');
const path = require('path');

// 1. Definição do local físico no disco
const baseDir = '/home/node/.n8n-files/requisitos/raw/';

// 2. Cria a pasta fisicamente se ela não existir
if (!fs.existsSync(baseDir)) {
    fs.mkdirSync(baseDir, { recursive: true });
}

return $input.all().map(item => {
    const rawData = item.json.data;

    try {
        // --- PARTE 1: EXTRAÇÃO DOS DADOS ---
        const jsonMatch = rawData.match(/data:\s*({.*})/s);
        if (!jsonMatch) return { json: { skip: true, motivo: "Regex falhou" } };

        const parsed = JSON.parse(jsonMatch[1].trim());
        const artefato = parsed.result.structuredContent.result;

        if (typeof artefato === 'string' || !artefato) {
            return { json: { skip: true, motivo: "Artefato vazio ou inválido" } };
        }

        // --- PARTE 2: DEFINIÇÃO DE CONTEÚDO E TIPO ---
        const isBinary = !!artefato.conteudo_base64;
        const conteudoParaGravar = isBinary ? artefato.conteudo_base64 : (artefato.conteudo || "");

        // --- PARTE 3: TRATAMENTO DO NOME E EXTENSÃO INTELIGENTE ---
        const tituloOriginal = artefato.titulo || 'arquivo';
        let tituloLimpo = tituloOriginal.replace(/[^a-z0-9.]/gi, '_').toLowerCase();

        let fileName = `${artefato.id}_${tituloLimpo}`;

        if (isBinary) {
            // Se for binário e NÃO tiver extensão no nome, vamos descobrir qual é
            const temExtensao = fileName.includes('.');

            if (!temExtensao) {
                if (conteudoParaGravar.startsWith('UEsDBB')) fileName += '.zip'; // ZIP ou Office (XLSX, DOCX)
                else if (conteudoParaGravar.startsWith('iVBORw0KGgo')) fileName += '.png';
                else if (conteudoParaGravar.startsWith('/9j/')) fileName += '.jpg';
                else if (conteudoParaGravar.startsWith('JVBERi0')) fileName += '.pdf';
                else fileName += '.bin'; // Fallback para outros binários
            }
        } else {
            // Se for texto (Markdown) e não tiver a extensão, adiciona .md
            if (!fileName.endsWith('.md')) {
                fileName += '.md';
            }
        }

        const fullPath = path.join(baseDir, fileName);

        // --- PARTE 4: GRAVAÇÃO NO DISCO ---
        if (isBinary) {
            // Converte Base64 para Buffer
            fs.writeFileSync(fullPath, Buffer.from(conteudoParaGravar, 'base64'));
        } else {
            // Grava texto puro em UTF-8
            fs.writeFileSync(fullPath, conteudoParaGravar, 'utf8');
        }

        return {
            json: {
                status: "Sucesso",
                arquivo: fileName,
                caminho: fullPath,
                tipo: isBinary ? "Binário" : "Texto"
            }
        };

    } catch (e) {
        return { 
            json: { 
                erro: true, 
                detalhe: e.message,
                item_id: item.json.identifier || "desconhecido"
            } 
        };
    }
});
